import React from "react";

export default function Volunteers(){
    const volunteers = [
        { id: 1, name: "Ion Popescu", email: "ion@email.com" },
        { id: 2, name: "Maria Ionescu", email: "maria@email.com" },
    ];

    return(
        <div className="content-section active">
            <h2>Voluntari</h2>
            <table>
                <thead>
                <tr>
                    <th>Nume</th>
                    <th>Email</th>
                </tr>
                </thead>
                <tbody>
                {volunteers.map(v => (
                    <tr key={v.id}>
                        <td>{v.name}</td>
                        <td>{v.email}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
}
